        <div className="container">
            <div className="banner-img" style={{ background: "url(https://firebasestorage.googleapis.com/v0/b/it-cow.appspot.com/o/doctor_images%2Fkardiolog.jpg?alt=media&token=94941ec1-87b1-4c6f-bfa3-1fe64679d272)"}}>
                <div className="title">
                    <h1>Sdsd</h1>
                </div>
            </div>
        </div>
    )
}
